(416, '<h2><strong>Reasons to give Shopify the position for your success</strong></h2>\r\n'),
(417, '<h3><strong style="color:#94C03C;">Unlimited product inventory and customer data</strong></h3>\r\n\r\n<p>Manage your entire inventory with Shopify. Track stock counts, and automatically stop selling products when inventory runs out.&nbsp;There&#39;s no limit to the number or type of products you can sell in your online store.</p>\r\n'),
(418, '<h3><strong style="color:#94C03C;">Securely accept credit cards instantly with Shopify Payments</strong></h3>\r\n\r\n<p>You can accept Visa, Mastercard, Discover, and American Express the minute you launch your shop.&nbsp;From bitcoin to PayPal to iDEAL, Shopify integrates with over 70 external payment gateways from around the world.</p>\r\n'),
(419, '<h3><strong style="color:#94C03C;">Automate your process with 3rd party shipping apps</strong></h3>\r\n\r\n<p>Receive automatic shipping rates from major shipping carriers like UPS, USPS, and FedEx.&nbsp;Set up shipping rates by fixed-price, tiered pricing, weight-based, and location-based rates.</p>\r\n'),
(420, '<h3><strong style="color:#94C03C;">Run your business wherever you are on the mobile app</strong></h3>\r\n\r\n<p>Capture payments and fulfill orders right from your phone. Send shipping notifications from the post office. Quickly see items that need your attention, and track trends in your business.</p>\r\n'),
(421, '<h3><strong style="color:#94C03C;">Detailed reporting, track sales and growth trends</strong></h3>\r\n\r\n<p>Analyze and gain insight into your store&#39;s growth. See which products are selling &mdash; and which ones aren&#39;t.&nbsp;See where your visitors come from, and how they found your online store.&nbsp;Reports can also be exported for further analysis.</p>\r\n'),
(422, '<h3><strong style="color:#94C03C;">Sell online and accept payments in-store with POS</strong></h3>\r\n\r\n<p>Shopify&#39;s POS software makes it easy to swipe credit cards and take cash offline, within your store by your customers side.&nbsp;Your Shopify Payments account is set up in less than 5 minutes, letting you process your customers&rsquo; credit cards directly through Shopify.</p>\r\n'),
(423, '<h3><strong style="color:#94C03C;">Discount codes, coupons and gift cards</strong></h3>\r\n\r\n<p>Run sales and promotions by offering coupon codes that save customers money. You choose whether the discount is for dollars off, a percentage off, free shipping, etc.&nbsp;Your customers are able to purchase a gift card for someone from your store, or you can use gift cards as store credit.</p>\r\n'),
(424, '<h3><strong style="color:#94C03C;">Sell on Facebook and more with social media integration</strong></h3>\r\n\r\n<p>All Shopify websites include social media integration, such as Pinterest, Instagram, Facebook, Twitter, and Tumblr.&nbsp;Your Facebook fans can browse your products and make a purchase without leaving Facebook.</p>\r\n'),
(425, '<h3><strong style="color:#94C03C;">Unlimited product inventory and customer data</strong></h3>\r\n\r\n<p>Manage your entire inventory. Track stock counts, and automatically stop selling products when inventory runs out.&nbsp;There&#39;s no limit to the number or type of products you can sell in your online store.</p>\r\n'),
(426, '<h3><strong style="color:#94C03C;">Securely accept credit cards instantly with Shopify Payments</strong></h3>\r\n\r\n<p>Accept Visa, Mastercard, Discover, and American Express the minute you launch your shop.&nbsp;From bitcoin to PayPal to iDEAL, a solution that integrates with over 70 external payment gateways from around the world.</p>\r\n'),
(427, '<h3><strong style="color:#94C03C;">Automate your process with 3rd party shipping apps</strong></h3>\r\n\r\n<p>Receive automatic shipping rates from major shipping carriers like UPS, USPS, and FedEx.&nbsp;Set up shipping rates by fixed-price, tiered pricing, weight-based, and location-based rates. Setting up shipping details is now easy.</p>\r\n'),
(428, '<h3><strong style="color:#94C03C;">Run your business wherever you are on the mobile app</strong></h3>\r\n\r\n<p>Capture payments and fulfill your orders right from your phone. Send shipping notifications from the post office. Quickly see items that need your attention, and track trends as they happen in your store.</p>\r\n'),
(429, '<h3><strong style="color:#94C03C;">Detailed reporting, track sales and growth trends</strong></h3>\r\n\r\n<p>Analyze and gain insight into your store&#39;s growth. See which products are selling &mdash; and which ones aren&#39;t.&nbsp;See where your visitors come from, and how they found your online store, exporting reports for further analysis.</p>\r\n'),
(430, '<h3><strong style="color:#94C03C;">Sell online and accept payments in-store with POS</strong></h3>\r\n\r\n<p>POS&nbsp;software makes it easy to swipe credit cards and take cash offline, in your store standing by your customers side.&nbsp;Your Shopify Payments account is set up in less than 5 minutes, letting you process your customers&rsquo; credit cards directly through Shopify.</p>\r\n'),
(431, '<h3><strong style="color:#94C03C;">Discount codes, coupons and gift cards</strong></h3>\r\n\r\n<p>Run sales and promotions by offering coupon codes that save customers money. Choose whether the discount is for money off, a percentage off, free shipping, etc.&nbsp;Your customers are able to purchase a gift card for someone from your store, or you can use gift cards as store credit.</p>\r\n'),
(432, '<h3><strong style="color:#94C03C;">Sell on Facebook and more with social media integration</strong></h3>\r\n\r\n<p>All Shopify solutions include social media integration, such as Pinterest, Instagram, Facebook, Twitter, and Tumblr.&nbsp;Your Facebook fans can browse your products and make a purchase without even leaving Facebook.</p>\r\n'),
(433, '<h2><strong>Your shop, your brand.</strong> We bring your commerce store to life with Shopify.</h2>\r\n\r\n<p>Your online store should be your store. Shopify allows us to take years of experience, and apply a bespoke solution to your store. Applying a bespoke designed solution, your brand will be present from the core of your store and beyond - something that doesn&#39;t come straight out the box. Bespoke domain names, everything you need in one place, a unified platform to run your store.</p>\r\n\r\n<p><a class="abtn shopify" href="#">Discuss your eCommerce project today</a></p>\r\n'),
