(464, '<h2><strong>Shopify and I are like best friends; companions, chums, homies - we&#39;re like dippy egg and soldiers. Why?</strong></h2>\r\n\r\n<h2><strong>Shopify provides eCommerce software that is, well... I&#39;ve seen eCommerce made more complicated than it needs be, Shopify brings no dead end. Combined, we create and provide a scalable eCommerce solution.</strong></h2>\r\n'),
(465, '<h2 class="colour-white"><strong>Shopify has a mission, and I&#39;ve teamed up with them to help carry that through - <u>to make eCommerce better for everyone</u>.</strong></h2>\r\n'),
