(477, '<h2 class="colour-white"><strong>I take pleasure in envisioning, designing and bringing to life your mobile app ideas - <u>through both the iOS and Android OS</u>.</strong></h2>\r\n'),
(478, '<h1 class="colour-white"><strong>That feeling inside when you realise your Mobile Application is REAL.</strong></h1>\r\n'),
(479, '<h2><strong>I started to design and develop mobile applications because I loved designing and developing for the web. The reason is simple, and I&#39;ve never looked back. I get a kick out of bringing your ideas and visions into a functional and seeable format. Every new project brings a different set of challenges, combining new and current technologies to guarantee performance, scaling and reliability.</strong></h2>\r\n'),
(480, '<h2><strong>Your mobile app, launch it.</strong> Let&#39;s take it to your already mobile addicted audience.</h2>\r\n\r\n<h5>There are already so many mobile applications on the market that are identical from one enough, you want something unique, something branded - that&#39;s what I do. I listen to individuals, start-ups and brands, to uniquely help them prepare them for what hungry excitement lies ahead. From the collaborative planning, through to design, development, testing and launch. Let me create something beautiful for you and your audience.&nbsp;</h5>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<h5><strong>DID YOU KNOW - </strong>a&nbsp;study showed that the average user spends 67 hours a month browsing on their mobile device, with 90% of that time used within third-party installed&nbsp;applications.</h5>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<p><a class="abtn mobileapp" href="#ecommerce-form">Make it real, let&#39;s start your mobile application project today</a></p>\r\n'),
(481, '<h1 class="colour-white"><strong>That feeling inside when you realise your Mobile Application is REAL.</strong></h1>\r\n'),
(482, '<h2 class="colour-white"><strong>I take pleasure in envisioning, designing and bringing to life your mobile app ideas - <u>through both iOS and Android OS</u>.</strong></h2>\r\n'),
(483, '<h2><strong>A few benefits that I include and I think you&#39;ll really like, into your mobile application solution.</strong></h2>\r\n'),
(484, '<h3><strong style="color:#94C03C;">Swift and Kotlin, always using the latest languages</strong></h3>\r\n\r\n<p>Manage your entire inventory. Track stock counts, and automatically stop selling products when inventory runs out.&nbsp;There&#39;s no limit to the number or type of products you can sell in your online store.</p>\r\n'),
(485, '<h3><strong style="color:#94C03C;">Swift and Kotlin, always using the latest languages</strong></h3>\r\n\r\n<p>Your app is built using the latest of OS languages, resulting in great stability and reliability on every level. This also ensures a future proofed foundation, combined with the latest frameworks.</p>\r\n'),
(486, '<h3><strong style="color:#94C03C;">Bespoke app design with unique functionality</strong></h3>\r\n\r\n<p>Every project is treated differently, all with a unique sense of direction. I ensure a growing realisation for your vision is meet, drawing from a blank canvas and guaranteeing your app stands out.&nbsp;</p>\r\n'),
(487, '<h3><strong style="color:#94C03C;">Swift and Kotlin, always using the latest languages</strong></h3>\r\n\r\n<p>Your app is built using the latest of OS languages, resulting in great stability and reliability on every level. This also ensures a future proofed foundation, combined with the latest frameworks.</p>\r\n'),
(488, '<h3><strong style="color:#94C03C;">Complete upfront app planning</strong></h3>\r\n\r\n<p>It&rsquo;s key that we outline all desired functionality and features in place and &ldquo;down on paper&rdquo; before the app process begins. We&rsquo;ll meet and collaborate on the app as a whole before any design and development work.</p>\r\n'),
(489, '<h3><strong style="color:#94C03C;">100% bespoke design and unique functionality</strong></h3>\r\n\r\n<p>Every mobile application we design and develop is created from the ground up, with your every need in mind. We believe in a unique product for every service we provide to our clients - it&rsquo;s something we live by.</p>\r\n'),
(490, '<h3><strong style="color:#94C03C;">Complete design introduction, collaboration and satisfaction</strong></h3>\r\n\r\n<p>We sit down and discuss your every requirement. &nbsp;After we have created your layout wireframe and initial design, we will introduce our thoughts, ideas, and continue on collaboration.</p>\r\n'),
(491, '<h3><strong style="color:#94C03C;">Branding your App so it really is yours</strong></h3>\r\n\r\n<p>It&rsquo;s important that your app is branded to your unique organisation. You should be able to strip your name and logo from your content and still have your users know exactly who&rsquo;s mobile app they are using.</p>\r\n'),
(492, '<h3><strong style="color:#94C03C;">Publishing to App Stores, I&#39;ve got this</strong></h3>\r\n\r\n<p>Publishing an app can be a complicated process which can waste time and cause you a headache. They involve certificates and provisioning profiles. We&rsquo;ll set up the required accounts and get everything ready for you.</p>\r\n'),
(493, '<h3><strong style="color:#94C03C;">Bespoke App CMS, you&#39;ll have control</strong></h3>\r\n\r\n<p>Depending on your app requirements, we&rsquo;ll introduce a bespoke content management system (CMS) for your app. Enabling you to push content, notification and much more - all through to your app in live time.</p>\r\n'),
(494, '<h3><strong style="color:#94C03C;">Keep track with integrated Analytics</strong></h3>\r\n\r\n<p>Similar to that of the web, we integrate Google Analytics into your app. This allows you to view reports of user numbers, UI uses, what users enjoy accessing and read - all within your mobile application.</p>\r\n'),
(496, '<h3><strong style="color:#94C03C;">Accessibility friendly, throughout</strong></h3>\r\n\r\n<p>Most mobile OS&rsquo;s feature built-in accessibility features, accessibility APIs and much more - and we make sure we 100% support these without fail.<br />\r\nSupporting EVERY app user!</p>\r\n'),
(497, '<h3><strong style="color:#94C03C;">Get involved with Beta early access</strong></h3>\r\n\r\n<p>We love the beta testing stage. It&rsquo;s when your app really comes to life! When we run beta tests, we &nbsp;can allow multiple users early access - even you can beta test if you&rsquo;d like?</p>\r\n'),
(499, '<h2><strong>Get straight to growing your business</strong></h2>\r\n\r\n<p>Let us handle the rest.&nbsp;When I say it&rsquo;s never been easier to start a business, we mean it. Shopify handles everything from marketing and payments, to secure checkout and shipping. Now you can focus on the things you love and let me handel the &quot;getting you up and running&quot; side of things.&nbsp;</p>\r\n');
