(520, '<h2><strong>Your mobile app, launch it.</strong> Let&#39;s take it to your already mobile addicted audience.</h2>\r\n\r\n<h5>There are already so many mobile applications on the market that are identical from one enough, you want something unique, something branded - that&#39;s what I do. I listen to individuals, start-ups and brands, to uniquely help them prepare them for what hungry excitement lies ahead. From the collaborative planning, through to design, development, testing and launch. Let me create something beautiful for you and your audience.&nbsp;</h5>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<h5><strong>DID YOU KNOW - </strong>a&nbsp;study showed that the average user spends 67 hours a month browsing on their mobile device, with 90% of that time used within third-party installed&nbsp;applications.</h5>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<p><a class="abtn mobileapp" href="#mobileapp-form">Make it real, let&#39;s start your mobile application project today</a></p>\r\n'),
(524, '<h1>Getting started on your Mobile App project</h1>\r\n\r\n<p>Discover the possibilities of your store, see how our bespoke eCommerce design solutions can benefit you - become unique and unlike the others.</p>\r\n'),
(525, '<h1>Getting started on your Website Design project</h1>\r\n\r\n<p>Discover the possibilities of your store, see how our bespoke eCommerce design solutions can benefit you - become unique and unlike the others.</p>\r\n'),
(527, '<h2><strong>A few benefits that I include and I think you&#39;ll really like, into your website design solution.</strong></h2>\r\n'),
(528, '<h3><strong style="color:#94C03C;">100% bespoke design and unique functionality</strong></h3>\r\n\r\n<p>Every website&nbsp;we design and develop is created from the ground up, with your every need in mind. We believe in a unique product for every service we provide to our clients - it&rsquo;s something we live by.</p>\r\n'),
(529, '<h3><strong style="color:#94C03C;">Complete design introduction, collaboration and satisfaction</strong></h3>\r\n\r\n<p>We sit down and discuss your every requirement.&nbsp;After we have created your layout wireframe and initial design, we will introduce our thoughts, ideas, and continue on collaboration.</p>\r\n'),
(530, '<h3><strong style="color:#94C03C;">60 &#39;to-the-minute&#39; support time, nothing else</strong></h3>\r\n\r\n<p>Your app is built using the latest of OS languages, resulting in great stability and reliability on every level. This also ensures a future proofed foundation, combined with the latest frameworks.</p>\r\n'),
(531, '<h3><strong style="color:#94C03C;">Responsive design to every device, uniquely responding</strong></h3>\r\n\r\n<p>It&rsquo;s key that we outline all desired functionality and features in place and &ldquo;down on paper&rdquo; before the app process begins. We&rsquo;ll meet and collaborate on the app as a whole before any design and development work.</p>\r\n'),
(532, '<h3><strong style="color:#94C03C;">Online bespoke Style Guidelines, know your way</strong></h3>\r\n\r\n<p>It&rsquo;s important that your app is branded to your unique organisation. You should be able to strip your name and logo from your content and still have your users know exactly who&rsquo;s mobile app they are using.</p>\r\n'),
(533, '<h3><strong style="color:#94C03C;">24/7 Support Access, reach for help</strong></h3>\r\n\r\n<p>Publishing an app can be a complicated process which can waste time and cause you a headache. They involve certificates and provisioning profiles. We&rsquo;ll set up the required accounts and get everything ready for you.</p>\r\n'),
