(662, '<h3><strong class="colour-orange">Bespoke App CMS, you&#39;ll have control</strong></h3>\r\n\r\n<p>Depending on your app requirements, I&#39;ll introduce a bespoke content management system (CMS) for your app. Enabling you to push content, notification and much more - all through to your app in live time.</p>\r\n'),
(663, '<h3><strong class="colour-orange">Keep track with integrated Analytics</strong></h3>\r\n\r\n<p>Similar to that of the web, I integrate Google Analytics into your app. This allows you to view reports of user numbers, UI uses, what users enjoy accessing and read - all within your mobile application.</p>\r\n'),
(664, '<h3><strong class="colour-orange">Accessibility friendly, throughout</strong></h3>\r\n\r\n<p>Most mobile OS&rsquo;s feature built-in accessibility features, accessibility APIs and much more - and I make sure I 100% support these without fail. Supporting EVERY app user!</p>\r\n'),
