(684, '<h1><strong>Can&#39;t find what you&#39;re looking for?</strong> Let&#39;s chat, don&#39;t be shy.</h1>\r\n\r\n<p>I&#39;ve listed my subjected expertise, but don&#39;t let that fool you. I undertake many different request variations for my clients, from the smallest of things like a logo or icon design, right through to setting up their complete marketing campaign, involving multiple HTML email designs and creations - so that my client are only left to&nbsp;final check their content and click send.</p>\r\n\r\n<h2><strong>It may&nbsp;only take 5 minutes.</strong></h2>\r\n\r\n<p>Alternitivly, let me can call you. Leave your details and I&#39;ll call you back within a few hours, or ASAP. <em>If in the very rare occurrence that we can&#39;t help, we may know a trusted person who can.</em></p>\r\n'),
