(720, '<p class="colour-white">Your online store should be your store. With Shopify and a bespoke designed solution, your brand will be present from the core and beyond - something that doesn&#39;t come straight out the box.</p>\r\n'),
(721, '<p class="colour-white">Manage your entire inventory. Track stock counts, and automatically stop selling products when inventory runs out.&nbsp;There&#39;s no limit to the number or type of products you can sell in your online store.</p>\r\n'),
(722, '<p class="colour-white">Capture payments and fulfill your orders right from your phone. Send shipping notifications from the post office. Quickly see items that need your attention, and track trends as they happen in your store.</p>\r\n'),
(723, '<p class="colour-white">And the list goes on... <a href="{CCM:CID_202}" title="Find out more about your eCommerce Design solution">Find out more!</a></p>\r\n'),
(724, '<p class="colour-white">Your app is built using the latest of OS languages, resulting in great stability and reliability on every level. This also ensures a future proofed foundation, combined with the latest frameworks.</p>\r\n'),
(725, '<p class="colour-white">Every mobile application I design and develop is created from the ground up, with your every need in mind. I believe in a unique product for every service provided to my clients - it&rsquo;s something I live by.</p>\r\n'),
(726, '<p class="colour-white">Similar to that of the web, I integrate Google Analytics into your app. This allows you to view reports of user numbers, UI uses, what users enjoy accessing and read - all within your mobile application.</p>\r\n'),
(727, '<p class="colour-white">And the list goes on... <a href="{CCM:CID_211}" title="Find out more about your Mobile Application solution">Find out more!</a></p>\r\n'),
(728, '<p class="colour-white">Your website will be 100% responsive from the word go - promise. Built in the current mobile world, not 1998. Having to &quot;opt-in&quot; to receive responsive design shouldn&rsquo;t be required. Your website will look great on all desktop and mobile devices.</p>\r\n'),
(729, '<p class="colour-white">I always have you at heart, things shouldn&#39;t be harder than they need to be. That&#39;s why I have put years of trust into our CMS. It&#39;s ease of use and broad functionality makes it a true winner for all our clients.</p>\r\n'),
(730, '<p class="colour-white">And the list goes on... <a href="{CCM:CID_212}" title="Find out more about website design solution">Find out more!</a></p>\r\n'),
(731, '<p class="colour-white">I truly believe and follow that all websites, no matter what, should be accessible 24/7, 365 days of the year. I monitor every single one of your websites, making sure it is online - just like it should always be.</p>\r\n'),
(732, '<h3><strong style="color:#94C03C;">Unlimited product inventory and customer data</strong></h3>\r\n\r\n<p>Manage your entire inventory. Track stock counts, and automatically stop selling products when inventory runs out.&nbsp;There&#39;s no limit to the number or type of products you can sell in your online store.</p>\r\n'),
(733, '<h3><strong style="color:#94C03C;">Securely accept credit cards instantly with Shopify Payments</strong></h3>\r\n\r\n<p>Accept Visa, Mastercard, Discover, and American Express the minute you launch your shop.&nbsp;From bitcoin to PayPal to iDEAL, a solution that integrates with over 70 external payment gateways from around the world.</p>\r\n'),
(734, '<h3><strong style="color:#94C03C;">Automate your process with 3rd party shipping apps</strong></h3>\r\n\r\n<p>Receive automatic shipping rates from major shipping carriers like UPS, USPS, and FedEx.&nbsp;Set up shipping rates by fixed-price, tiered pricing, weight-based, and location-based rates. Setting up shipping details is now easy.</p>\r\n'),
(735, '<h3><strong style="color:#94C03C;">Run your business wherever you are on the mobile app</strong></h3>\r\n\r\n<p>Capture payments and fulfill your orders right from your phone. Send shipping notifications from the post office. Quickly see items that need your attention, and track trends as they happen in your store.</p>\r\n'),
(736, '<h3><strong style="color:#94C03C;">Detailed reporting, track sales and growth trends</strong></h3>\r\n\r\n<p>Analyze and gain insight into your store&#39;s growth. See which products are selling &mdash; and which ones aren&#39;t.&nbsp;See where your visitors come from, and how they found your online store, exporting reports for further analysis.</p>\r\n'),
(737, '<h3><strong style="color:#94C03C;">Sell online and accept payments in-store with POS</strong></h3>\r\n\r\n<p>POS&nbsp;software makes it easy to swipe credit cards and take cash offline, in your store standing by your customers side.&nbsp;Your Shopify Payments account is set up in less than 5 minutes, letting you process your customers&rsquo; credit cards directly through Shopify.</p>\r\n'),
(738, '<h3><strong style="color:#94C03C;">Discount codes, coupons and gift cards</strong></h3>\r\n\r\n<p>Run sales and promotions by offering coupon codes that save customers money. Choose whether the discount is for money off, a percentage off, free shipping, etc.&nbsp;Your customers are able to purchase a gift card for someone from your store, or you can use gift cards as store credit.</p>\r\n'),
(739, '<h3><strong style="color:#94C03C;">Sell on Facebook and more with social media integration</strong></h3>\r\n\r\n<p>All Shopify solutions include social media integration, such as Pinterest, Instagram, Facebook, Twitter, and Tumblr.&nbsp;Your Facebook fans can browse your products and make a purchase without even leaving Facebook.</p>\r\n'),
(740, '<div>\r\n<h3><strong style="color:#94C03C;">An eCommerce platform that is continuously growing, even&nbsp;if you can&#39;t see it. Regular updates, SSL security, 99.99% uptime&nbsp;and more...</strong></h3>\r\n\r\n<p><strong>With so many features, Shopify really doe hits the nail on the head. And here are a few more;</strong><br />\r\nFull blogging platform, free SSL certificate, automatic taxes, abandoned checkout recovery, customer accounts and profiles, refunds, email templates, product reviews, email marketing, import/export, multiple images, unlimited bandwidth,&nbsp;99.99% uptime and 24/7 monitoring, traffic/referral reports,&nbsp;export reports, email or call customers, dedicated support team, and the list goes on.</p>\r\n</div>\r\n'),
(741, '<h2><strong>Your shop, your brand.</strong> I bring your eCommerce store to life and integrate into Shopify.</h2>\r\n\r\n<h5>Your online store should be your store. Shopify allows me to take years of experience, and apply a bespoke solution to your store. Applying a bespoke designed solution, your brand will be present from the core, and beyond - something that doesn&#39;t come straight out the box! Bespoke domain names, everything you need in one place, a unified platform to run your store.</h5>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<h5><strong>DID YOU KNOW - </strong>a&nbsp;study showed that 94% of users disTRUSTED a website because of the DESIGN made them uneasy.</h5>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<p><a class="abtn shopify" href="#ecommerce-form" title="Enquiry about your Shopify eCommerce solution"><strong>Build trust,</strong> Chat about your Shopify eCommerce project today.</a></p>\r\n'),
(742, '<h2><strong>Stop dreaming, start achieving.</strong> I&#39;ll help make your website become reality.</h2>\r\n\r\n<h5>With the growing numbers of website on the internet, there are 100&#39;s, if not 1000&#39;s, of new comers during a month period. This means that the game gets harder with every day that passes. I take pride in ensuring that the online appearance of individuals, start-ups and brands, go above and beyond compared to competitors. Let me create something beautiful for you and your audience.</h5>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<h5><strong>DID YOU KNOW - </strong>a study showed that 59% of consumers globally would rather engage with content that&#39;s beautifully designed as opposed to simply designed &mdash; even when short on time.</h5>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<p><a class="abtn websitedesign blue-dark" href="#websitedesign-form" title="Enquiry about your bespoke website design solution">Reach your online audience, chat about starting your website project today</a></p>\r\n'),
(743, '<h3><strong class="colour-blue-dark">100% bespoke design and unique functionality</strong></h3>\r\n\r\n<p>Every website&nbsp;designed and develop is created from the ground up, with your every need in mind. I believe in a unique product for every service provided to clients - it&rsquo;s something I live by.</p>\r\n'),
(744, '<h3><strong class="colour-blue-dark">Complete design introduction, collaboration and satisfaction</strong></h3>\r\n\r\n<p>We&#39;ll sit down and discuss your every requirement.&nbsp;After your layout wireframe&nbsp;and initial design has been designed, we&#39;ll introduce and express&nbsp;our thoughts, ideas, and continue on collaboration.</p>\r\n'),
(745, '<h3><strong class="colour-blue-dark">60 &#39;to-the-minute&#39; support time, nothing else</strong></h3>\r\n\r\n<p>Include with every solution are 60-minutes of support time each month, for 12 months. All support is timed to the minute, not in incremental jumps. This means you receive what you should, and nothing less.</p>\r\n'),
(746, '<h3><strong class="colour-blue-dark">Responsive design to every device, uniquely responding</strong></h3>\r\n\r\n<p>Your website will be 100% responsive from the word go - promise. Built in the current mobile world, not 1998. Having to &quot;opt-in&quot; to receive responsive design shouldn&rsquo;t be required. Your website will look great on all desktop and mobile devices.</p>\r\n'),
(747, '<h3><strong class="colour-blue-dark">Online bespoke Style Guidelines, know your way</strong></h3>\r\n\r\n<p>With my understanding and knowledge of brand, and the importance of design consistency, we take a step further - I provide a unique online cheatsheet to all clients. Showing all your colours, typeface, short-codes and more.</p>\r\n'),
(748, '<h3><strong class="colour-blue-dark">24/7 Support Access, always reach for help</strong></h3>\r\n\r\n<p>Access support at almost any time through our fully integrated online ticketing system. Standard support operation times are 8am to 5pm, furthermore including live chat and an urgent priority for those naughty slip-ups.</p>\r\n'),
(749, '<h3><strong class="colour-blue-dark">Full Management System (CMS), you&#39;ll have control</strong></h3>\r\n\r\n<p>I always have you at heart, things shouldn&#39;t be harder than they need to be. That&#39;s why I have put years of trust into our CMS. It&#39;s ease of use and broad functionality makes it a true winner for all our clients.</p>\r\n'),
(750, '<h3><strong class="colour-blue-dark">Keep track with integrated Analytics and Reports</strong></h3>\r\n\r\n<p>As standard, I integrate Google Analytics (GA) into every website we develop. This allows you to view reports of visitor numbers, how visitors find you, referral websites, what visitors enjoy downloading and read on your website.</p>\r\n'),
(751, '<h3><strong class="colour-blue-dark">Search Engine Optimisation (SEO), be crawled and found</strong></h3>\r\n\r\n<p>All websites should be search engine friendly, because yours will be. Fully responsive, automatic creation of titles and meta tags, URL rewriting, search engine submission and speed optimisation.</p>\r\n'),
(752, '<h3><strong class="colour-blue-dark">Reliable Hosting, in upward&nbsp;of a&nbsp;solid 99.9% uptime</strong></h3>\r\n\r\n<p>I have invested time and money in finding the fastest, safest and most reliable hosting around. I can promise all of this, as well as your website using the latest of technologies in it&rsquo;s class, with upward of 99.9% uptime.</p>\r\n'),
(753, '<h3><strong class="colour-blue-dark">Disaster Recovery for your data, we have you covered</strong></h3>\r\n\r\n<p>Your unique website will be hosted within our unique Azure virtual Infrastructure, which is ultra fast! This enabled me to take multiple backups of your data and store it in multiple, fully encrypted, locations - leaving you completely worry free.</p>\r\n'),
(754, '<h3><strong class="colour-blue-dark">On-Site staff CMS website training, be in the know&nbsp;&nbsp;</strong></h3>\r\n\r\n<p>The best way to learn is to dive into the deep end. With 1 hour on-site (location dependant) CMS training for 2 staff members, we&#39;ll go through the ins and outs of adding, editing and deleting pages, adding functionality and element styling.</p>\r\n'),
(755, '<h3><strong class="colour-blue-dark">Uptime monitoring and reporting,&nbsp;24/7/365 days of the year</strong></h3>\r\n\r\n<p>I truly believe and follow that all websites, no matter what, should be accessible 24/7, 365 days of the year. I monitor every single one of your websites, making sure it is online - just like it should always be.</p>\r\n'),
(756, '<h3><strong class="colour-blue-dark">Content Migration, we&#39;ll take some of that work load</strong></h3>\r\n\r\n<p>Yes, thats right! Not only do I handle all of the web design, development and technical stuff, but I also offer help during the migration of your content. Whether it&#39;s coming from your old site, or documentation, I really don&#39;t mind.&nbsp;</p>\r\n'),
(757, '<h2><strong>Your mobile app, launch it.</strong> Let&#39;s take it to your already mobile addicted audience.</h2>\r\n\r\n<h5>There are already so many mobile applications on the market that are identical from one enough, you want something unique, something branded - that&#39;s what I do. I listen to individuals, start-ups and brands, to uniquely help them prepare them for what hungry excitement lies ahead. From the collaborative planning, through to design, development, testing and launch. Let me create something beautiful for you and your audience.&nbsp;</h5>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<h5><strong>DID YOU KNOW - </strong>a&nbsp;study showed that the average user spends 67 hours a month browsing on their mobile device, with 90% of that time used within third-party installed&nbsp;applications.</h5>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<p><a class="abtn mobileapp" href="#mobileapp-form" title="Enquiry about your mobile application today">Don&#39;t regret it, chat about your mobile application project today</a></p>\r\n'),
(758, '<h3><strong class="colour-orange">Swift and Kotlin, always using the latest languages</strong></h3>\r\n\r\n<p>Your app is built using the latest of OS languages, resulting in great stability and reliability on every level. This also ensures a future proofed foundation, combined with the latest frameworks.</p>\r\n'),
(759, '<h3><strong class="colour-orange">Complete upfront app planning</strong></h3>\r\n\r\n<p>It&rsquo;s key that we outline all desired functionality and features in place and &ldquo;down on paper&rdquo; before the app process begins. We&rsquo;ll meet and collaborate on the app as a whole before any design and development work.</p>\r\n'),
(760, '<h3><strong class="colour-orange">100% bespoke design and unique functionality</strong></h3>\r\n\r\n<p>Every mobile application I design and develop is created from the ground up, with your every need in mind. I believe in a unique product for every service provided to my clients - it&rsquo;s something I live by.</p>\r\n'),
(761, '<h3><strong class="colour-orange">Complete design introduction, collaboration and satisfaction</strong></h3>\r\n\r\n<p>We sit down and discuss your every requirement. &nbsp;After we have created your layout wireframe and initial design, we will introduce our thoughts, ideas, and continue on collaboration.</p>\r\n'),
(762, '<h3><strong class="colour-orange">Branding your App so it really is yours</strong></h3>\r\n\r\n<p>It&rsquo;s important that your app is branded to your unique organisation. You should be able to strip your name and logo from your content and still have your users know exactly who&rsquo;s mobile app they are using.</p>\r\n'),
(763, '<h3><strong class="colour-orange">Publishing to App Stores, I&#39;ve got this</strong></h3>\r\n\r\n<p>Publishing an app can be a complicated process which can waste time and cause you a headache. They involve certificates and provisioning profiles. I&#39;ll set up the required accounts and get everything ready for you.</p>\r\n'),
(764, '<h3><strong class="colour-orange">Bespoke App CMS, you&#39;ll have control</strong></h3>\r\n\r\n<p>Depending on your app requirements, I&#39;ll introduce a bespoke content management system (CMS) for your app. Enabling you to push content, notification and much more - all through to your app in live time.</p>\r\n'),
(765, '<h3><strong class="colour-orange">Keep track with integrated Analytics</strong></h3>\r\n\r\n<p>Similar to that of the web, I integrate Google Analytics into your app. This allows you to view reports of user numbers, UI uses, what users enjoy accessing and read - all within your mobile application.</p>\r\n'),
(766, '<h3><strong class="colour-orange">Accessibility friendly, throughout</strong></h3>\r\n\r\n<p>Most mobile OS&rsquo;s feature built-in accessibility features, accessibility APIs and much more - and I make sure I 100% support these without fail. Supporting EVERY app user!</p>\r\n'),
(767, '<h3><strong class="colour-orange">Get involved with Beta early access</strong></h3>\r\n\r\n<p>I love the beta testing stage. It&rsquo;s when your app really comes to life! When&nbsp;runnning beta tests, I&nbsp;can allow multiple users early access - which means even you can beta test, if you&rsquo;d like?</p>\r\n'),
