(772, '<h2><strong>It will ONLY take a minute.</strong></h2>\r\n\r\n<p><a href="{CCM:CID_159}" title="eCommerce, mobile app and website design solutions">Have you seen my solutions for you?</a>&nbsp;We can have a chat about a solution that you may require, or something you need to know about - even if you&#39;re not confident on what you need.</p>\r\n\r\n<p>Have you seen my most common solutions, but don&#39;t let that fool you. I undertake many different request variations for my clients, from the smallest of things like a logo or icon design, right through to setting up their complete marketing campaign, involving multiple HTML email designs and creations - so that my client are only left to&nbsp;final check their content and click send.</p>\r\n\r\n<p>We can have a chat about a solution that you may require, or something you need to know about - even if you&#39;re not confident on what you need.</p>\r\n'),
(773, '<h2><strong>It will ONLY take a minute.</strong></h2>\r\n\r\n<p><a href="{CCM:CID_159}" title="website, ecommerce and mobile app design solutions">Have you seen my most common solutions?</a>&nbsp;I undertake many different request variations for my clients, from the smallest of things like a logo or icon design, right through to setting up their complete start-up branding or marketing campaign, involving multiple HTML email designs and creations - so that my client are only left to&nbsp;final check their content and click send.</p>\r\n\r\n<p>We can have a chat about a solution that you may require, or something you need to know about - even if you&#39;re not confident on what you need, let&#39;s start.</p>\r\n'),
(774, '<h2><strong>It will ONLY take a minute.</strong></h2>\r\n\r\n<p><a href="{CCM:CID_159}" title="website, ecommerce and mobile app design solutions">Have you seen my most common solutions?</a>&nbsp;I undertake many different request variations for my clients, from the smallest of things like a logo or icon design, right through to setting up their complete start-up branding or marketing campaign, involving multiple HTML email designs and creations - so that my client are only left to&nbsp;final check their content and click send.</p>\r\n\r\n<p>Take a minute and fill in the form below. We can have a chat about a solution that you may require, or something you need to know about - even if you&#39;re not confident on what you need.</p>\r\n'),
(775, '<h1 class="colour-white"><strong>Trusted solutions that get you off the ground.</strong> Guaranteed.</h1>\r\n'),
(776, '<p class="colour-white">With the growing numbers of website on the internet, there are 100&#39;s, if not 1000&#39;s, of new comers during a month period. This means that the game gets harder with every day that passes. I take pride in ensuring that the online appearance of individuals, start-ups and established brands, go above and beyond compared to competitors. Let me create something beautiful for you and your audience.</p>\r\n'),
(777, '<h2 class="colour-white">Ensuring the online appearance of individuals, start-ups and established brands.</h2>\r\n'),
(778, '<h1 class="colour-white"><strong>I provide trusted solutions that will get you off the ground.</strong> Guaranteed.</h1>\r\n'),
(779, '<h2><strong>Stop dreaming, start achieving.</strong> I&#39;ll help make your website become reality.</h2>\r\n\r\n<h5>With the growing numbers of website on the internet, there are 100&#39;s, if not 1000&#39;s, of new comers during a month period. This means that the game gets harder with every day that passes. I take pride in ensuring that the online appearance of individuals, start-ups and established brands, go above and beyond compared to competitors. Let me create something beautiful for you and your audience.</h5>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<h5><strong>DID YOU KNOW - </strong>a study showed that 59% of consumers globally would rather engage with content that&#39;s beautifully designed as opposed to simply designed &mdash; even when short on time.</h5>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<p><a class="abtn websitedesign blue-dark" href="#websitedesign-form" title="Enquiry about your bespoke website design solution">Reach your online audience, chat about starting your website project today</a></p>\r\n'),
(780, '<h2 class="colour-white">I take pleasure in envisioning, designing and bringing to life your bespoke website ideas - <u>with both beautiful design and a functional CMS</u>.</h2>\r\n'),
(781, '<h1 class="colour-white"><strong>DIY website services are tinny and limited.</strong> That&#39;s why CLIENTS LOVE my services.</h1>\r\n'),
(782, '<h1 class="colour-white"><strong>DIY website services are limited.</strong> That&#39;s why CLIENTS LOVE my services.</h1>\r\n'),
(783, '<h1 class="colour-white"><strong>What could only take a minute,</strong> may provide value in building your successful future.</h1>\r\n'),
(784, '<h2 class="colour-white">I enjoy providing solutions that matter to my clients, with no shortness in performance.</h2>\r\n'),
(785, '<ul>\r\n	<li><a class="contact colour-white type-lowercase type-semibold family-table" href="/index.php/get-in-contact" title="Enquire for eCommerce, Website Design and Mobile App solutions">Let&rsquo;s Talk?</a></li>\r\n	<li><a class="contact colour-white type-lowercase type-semibold family-table" href="/index.php/design-development-solutions-and-services" title="eCommerce, Website Design and Mobile App solutions">Become a Client</a></li>\r\n</ul>\r\n'),
(786, '<ul>\r\n	<li><a class="contact colour-white type-lowercase type-semibold family-table" href="/index.php/design-development-solutions-and-services" title="eCommerce, Website Design and Mobile App solutions">Become a Client</a></li>\r\n	<li><a class="contact colour-white type-lowercase type-semibold family-table" href="/index.php/get-in-contact" title="Enquire for eCommerce, Website Design and Mobile App solutions">Let&rsquo;s Talk?</a></li>\r\n</ul>\r\n'),
(787, '<h1>Subjects that I have a passion for.</h1>\r\n\r\n<p>Creating partnerships. Understanding Problems. Creating Solutions &nbsp;-&nbsp;<em>and here&#39;s why...</em></p>\r\n'),
(788, '<h1>Clients I&#39;ve learned about and respect.</h1>\r\n\r\n<p>I&#39;ve had the pleasure, and fortunate enough, to have built some expiring partnerships. Together, we&#39;ve helped to grow our knowledge and expertise to what it is today - thank you from the bottom.</p>\r\n'),
(789, '<h1 class="colour-white"><strong>It&#39;s not what I do that matters.</strong> It&#39;s what I do for my clients, for you, that matters.</h1>\r\n'),
(790, '<h2 class="colour-white">Creating partnerships. Understanding Problems. Creating Solutions.</h2>\r\n'),
(791, '<h2 class="colour-orange"><strong>Creating Partnerships</strong></h2>\r\n\r\n<p>Meeting new clients is always a powerful time, it&#39;s what creation is all about. It&#39;s what allows our core to grow and broaden. Every clients is in a different place - whether it&#39;s position, size or location. I love creating, learning and building partnerships, contributing towards a clients successful future.</p>\r\n'),
(792, '<h2 class="colour-orange"><strong>Understanding Problems</strong></h2>\r\n\r\n<p>No one like to discover or fabricate a problem - including me. But the scale of problems can vary. They can cause issues as little as being unable to download&nbsp;documents. Or can stop clients meeting targets and growing their vision. Understanding a problem can be tricky, I desire the warmth when insight becomes clear.</p>\r\n'),
(793, '<h2 class="colour-orange"><strong>Creating Solutions</strong></h2>\r\n\r\n<p>Solutions resolve problems - they resolve a clients demand. Partnerships spark when a client has a problem that requires a solution. A bespoke solution that is provide by the understanding of the problem. With commitment from clients, it&#39;s what I reach for, what we partner for - what feeds my passion.</p>\r\n'),
(794, '<h1 class="colour-white"><strong>Latest news and updates</strong>. From my studio, my home and my life.</h1>\r\n'),
(795, '<h2 class="sub-heading colour-grey title-sub"><strong>While I&#39;m not knee deep in enjoyment with the undertaking of projects, I like to keep my clients and visitors up to date with the latest news and work from my studio and home in London, United Kingdom. Whether it&#39;s work life, client problem solving, learning new things, personal or family life - I enjoy telling stories.</strong></h2>\r\n\r\n<p>Join our conversation online and <a href="#">subscribe&nbsp;to receive our monthly newsletters</a>.<br />\r\nI&rsquo;ll only email you with important bits, never spam - that&#39;s a&nbsp;pinky promise!</p>\r\n'),
(797, '<h1 class="colour-white"><strong>Project case studies&nbsp;I think you&#39;ll enjoy</strong>. A small insight into successful solutions.</h1>\r\n'),
(798, '<h2 class="colour-white">Solutions that are built&nbsp;from my clients ideas, dreams and requirments - even&nbsp;uncertainty.</h2>\r\n'),
(799, '<h2><strong>While I&#39;m not knee deep in enjoyment with the undertaking of projects, I like to keep my clients and visitors up to date with the latest news and work from my studio and home in London, United Kingdom. Whether it&#39;s work life, client problem solving, learning new things, personal or family life - I enjoy telling stories.</strong></h2>\r\n\r\n<p>Join our conversation online and&nbsp;<a href="{CCM:BASE_URL}/index.php/blog#">subscribe&nbsp;to receive our monthly newsletters</a>.<br />\r\nI&rsquo;ll only email you with important bits, never spam - that&#39;s a&nbsp;pinky promise!</p>\r\n'),
(800, '<h2><strong>Every single design or development project I undertake are non-identical. These require&nbsp;different tacktical methods with slightly different solutions -&nbsp;each completed with plenty of passion and determination.&nbsp;Here are a few of my clients projects that not only delivered great client satisfaction, but have provided an overall improvment.</strong></h2>\r\n\r\n<p>Join our conversation online and&nbsp;<a href="{CCM:BASE_URL}/index.php/blog#">subscribe&nbsp;to receive our monthly newsletters</a>.<br />\r\nI&rsquo;ll only email you with important bits, never spam - that&#39;s a&nbsp;pinky promise!</p>\r\n'),
(801, '<h2><strong>Every design or development project are non-identical. These require&nbsp;different tacktical methods with slightly different solutions -&nbsp;each completed with passion and determination.&nbsp;Here are a few of my clients projects that not only delivered great client satisfaction, but have provided an overall improvment.</strong></h2>\r\n\r\n<p>Join our conversation online and&nbsp;<a href="{CCM:BASE_URL}/index.php/blog#">subscribe&nbsp;to receive our monthly newsletters</a>.<br />\r\nI&rsquo;ll only email you with important bits, never spam - that&#39;s a&nbsp;pinky promise!</p>\r\n'),
(803, '<p>product involvment list here...</p>\r\n'),
(805, '<h2 class="colour-white">My store includes&nbsp;products I&#39;ve created in my spare time - which let&#39;s be honest, I have&nbsp;very little of.</h2>\r\n'),
(806, '<h1 class="colour-white"><strong>The Original.</strong> The Unique.</h1>\r\n');
