(821, '<h2 class="colour-white"><strong>There is no Cloud.</strong> Die Cut Magnet.</h2>\r\n'),
(822, '<h3 class="colour-white" style="padding:0;margin:0;"><strong>&pound;3.99</strong></h3>\r\n\r\n<p class="colour-white" style="padding:0;margin:0;">(exc. delivery)</p>\r\n'),
(823, '<h1 class="colour-white"><strong>There is no Cloud.</strong> Die Cut Magnet.</h1>\r\n'),
(824, '<p class="colour-white"><b>I celebrated&nbsp;15,000 units&nbsp;sold&nbsp;- now I&#39;m back for flying over the BIG&nbsp;20,000!</b><br />\r\nLimited number of indoor die cut flexible &quot;There is no cloud. It&#39;s just someone else&#39;s computer&quot; magnets now available. It&#39;s a limited product, this means first come, first served...</p>\r\n\r\n<p class="colour-white">To celebrate our run up to selling over an incredible 20,000 printed units of our #ThereIsNoCloud product through the fantastic guys over at StickerMule, Society6 and Spreadshirt, we have stocked more of our indoor die cut magnets. These magnets are shit hot and perfect for slapping on your home or office fridges, server or switch cabinets, computer towers, magnetic white boards - as well as millions of other metal surfaces that can be magnetised.</p>\r\n'),
(825, '<h3 class="colour-white" style="padding:0;margin:0;"><strong>&pound;3.99</strong></h3>\r\n\r\n<p class="colour-white" style="padding:0;margin:0;">(exc. delivery) -&nbsp;<strong>Dimensions:</strong>&nbsp;80x64x1 mm</p>\r\n'),
