(835, '<center>\r\n<h2><strong>There is no Cloud.</strong> Die Cut Sticker.</h2>\r\n\r\n<p><a href="https://www.stickermule.com/uk/marketplace/3442-there-is-no-cloud" target="_blank"><img alt="Original There is no Cloud sticker" longdesc="Original There is no Cloud sticker" src="https://www.stickermule.com/marketplace/embed_img/3442" style="max-height:200px;" title="Original There is no Cloud sticker" /></a></p>\r\n\r\n<h3 style="padding:0;margin:0;"><strong>&pound;3.33</strong>&nbsp;<em>(exc. delivery)</em></h3>\r\n\r\n<p>Your single Die-cut vinyl sticker is cut precisely to the design, with a small white border. Your sticker will be made of thick, durable vinyl with a UV laminate that protects the die-cut stickers from scratches, rain and sunlight.<br />\r\n<br />\r\n<strong>Dimensions:</strong>&nbsp;80x64 mm</p>\r\n\r\n<p><a class="abtn black" href="https://www.stickermule.com/uk/marketplace/3442-there-is-no-cloud" target="_blank" title="There is no cloud sticker">Buy this sticker</a></p>\r\n</center>\r\n'),
(836, '<center>\r\n<h2><strong>There is no Cloud.</strong> Die Cut Sticker Sheet.</h2>\r\n\r\n<p><a href="https://www.stickermule.com/uk/marketplace/15349-there-is-no-cloud-sheet" target="_blank"><img alt="There is no Cloud sticker sheet" longdesc="There is no Cloud sticker sheet" src="https://www.stickermule.com/marketplace/embed_img/15349" style="max-height:200px;" title="There is no Cloud sticker sheet" /></a></p>\r\n\r\n<h3 style="padding:0;margin:0;"><strong>&pound;12</strong> <em>(exc. delivery)</em></h3>\r\n\r\n<p>Sticker sheets include several different version of our original design, to one sheet. Each sticker is kiss cut so that you can peel each one off individually. Your sticker sheets will be made from thick, durable vinyl with a UV laminate to stand up to rain, wind and sun without fading.<br />\r\n<br />\r\n<strong>Dimensions:</strong>&nbsp;286x222 mm</p>\r\n\r\n<p><a class="abtn black" href="https://www.stickermule.com/uk/marketplace/15349-there-is-no-cloud-sheet" target="_blank" title="There is no cloud sticker">Buy this sticker sheet</a></p>\r\n</center>\r\n'),
(838, '<center>\r\n<h2><strong>Internet Privacy is Trash.</strong> Die Cut Sticker.</h2>\r\n\r\n<p><a href="https://www.stickermule.com/uk/marketplace/10676-internet-privacy-trash" target="_blank"><img alt="Original Internet Privacy is Trash sticker" longdesc="Original Internet Privacy is Trash sticker" src="https://www.stickermule.com/marketplace/embed_img/10676" style="max-height:200px;" title="Original Internet Privacy is Trash sticker" /></a></p>\r\n\r\n<h3 style="padding:0;margin:0;"><strong>&pound;3.34</strong> <em>(exc. delivery)</em></h3>\r\n\r\n<p>Your single Die-cut vinyl sticker is cut precisely to the design, with a small white border. Your sticker will be made of thick, durable vinyl with a UV laminate that protects the die-cut stickers from scratches, rain and sunlight.<br />\r\n<br />\r\n<strong>Dimensions:</strong>&nbsp;80x64 mm</p>\r\n\r\n<p><a class="abtn black" href="https://www.stickermule.com/uk/marketplace/3442-there-is-no-cloud" target="_blank" title="There is no cloud sticker">Buy this sticker</a></p>\r\n</center>\r\n'),
