(851, '<h1><strong>Can&#39;t find what you&#39;re looking for?</strong> Let&#39;s chat, don&#39;t be shy.</h1>\r\n\r\n<p><a href="{CCM:BASE_URL}/index.php/design-development-solutions-and-services" title="website, ecommerce and mobile app design solutions">Have you seen my most common solutions?</a> I undertake many different request variations for my clients, from the smallest of things like a logo or icon design, right through to setting up their complete start-up branding or marketing campaign, involving multiple HTML email designs and creations - so that my client are only left to&nbsp;final check their content and click send.</p>\r\n\r\n<h2><strong>It may&nbsp;only take 5 minutes.</strong></h2>\r\n\r\n<p>Alternitivly, let me can call you. Leave your details and I&#39;ll call you back within a few hours, or ASAP. <em>If in the very rare occurrence that we can&#39;t help, we may know a trusted person who can.</em></p>\r\n'),
(852, '<h2><strong>Every design or development project are non-identical. These require&nbsp;different tacktical methods with slightly different solutions -&nbsp;each completed with passion and determination.&nbsp;Here are a few of my clients projects that not only delivered great client satisfaction, but have exceeded the above and beyond.</strong></h2>\r\n\r\n<p>Join our conversation online and&nbsp;<a href="{CCM:BASE_URL}/index.php/blog#">subscribe&nbsp;to receive our monthly newsletters</a>.<br />\r\nI&rsquo;ll only email you with important bits, never spam - that&#39;s a&nbsp;pinky promise!</p>\r\n'),
(853, '<h2 class="type-semibold">eCommerce Design</h2>\r\n\r\n<p>Your shop, your brand. I bring your eCommerce store to life and integrate into Shopify. Your online store should be your store. Shopify allows me to take years of experience, and apply a bespoke solution to your store.</p>\r\n'),
(854, '<h2 class="type-semibold">Website Design</h2>\r\n\r\n<p>I take pride in ensuring that the online appearance of individuals, start-ups and established brands, go above and beyond compared to competitors. Let me create something beautiful for you and your audience.</p>\r\n'),
(855, '<h2 class="type-semibold">Mobile App</h2>\r\n\r\n<p>There are already so many mobile applications on the market that are identical from one another, you want something unique, something branded - that&#39;s what I do.&nbsp;Let me create something beautiful for you and your audience.</p>\r\n'),
(856, '<p class="colour-white">There are already so many mobile applications on the market that are identical from one another, you want something unique, something branded - that&#39;s what I do. I listen to individuals, start-ups and brands, to uniquely help them prepare them for what hungry excitement lies ahead. From the collaborative planning, through to design, development, testing and launch. Let me create something beautiful for you and your audience.</p>\r\n'),
(857, '<h2><strong>Your mobile app, launch it.</strong> Let&#39;s take it to your already mobile addicted audience.</h2>\r\n\r\n<h5>There are already so many mobile applications on the market that are identical from one another, you want something unique, something branded - that&#39;s what I do. I listen to individuals, start-ups and brands, to uniquely help them prepare them for what hungry excitement lies ahead. From the collaborative planning, through to design, development, testing and launch. Let me create something beautiful for you and your audience.&nbsp;</h5>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<h5><strong>DID YOU KNOW - </strong>a&nbsp;study showed that the average user spends 67 hours a month browsing on their mobile device, with 90% of that time used within third-party installed&nbsp;applications.</h5>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<p><a class="abtn mobileapp" href="#mobileapp-form" title="Enquiry about your mobile application today">Don&#39;t regret it, chat about your mobile application project today</a></p>\r\n'),
(858, '<h2 class="type-semibold">Let&#39;s chat about your solution</h2>\r\n\r\n<p><a class="abtn orange" href="{CCM:CID_159}" title="find out about my solutions">find out about my solutions</a></p>\r\n'),
