(864, '<h2 class="colour-white"><strong>The Original.</strong> The Unique.<br />\r\n#TherIsNoCloud</h2>\r\n\r\n<p class="colour-white">Never in a million years did I expect <a href="{CCM:CID_192}" title="my sticker, ‘There is No Cloud’">my sticker, &lsquo;There is No Cloud&rsquo;</a>, to go the way it did. It&rsquo;s just a pretty simple 8.13 x 6.45 cm die cut sticker. But unbelievably it went global!&nbsp;Over 20,000 printed units sold globally, the words are spreading far and wide.&nbsp;</p>\r\n\r\n<p class="colour-white">&quot;There is no cloud. It&#39;s just someone else&#39;s computer&quot; It&#39;s only the truth, but I wonder how many people really think there really is a &quot;cloud&quot; that stores all our data?</p>\r\n\r\n<p><a class="abtn grey small" href="/index.php/blog/my-there-is-no-cloud-sticker" title="find out more about \'There is no Cloud\' design">More about the &#39;There is no Cloud&#39; design</a> <a class="abtn grey small" href="/index.php/store" title="See our products and gifts which include There is no Cloud">Shop &#39;There is no Cloud&#39; products</a></p>\r\n'),
