(866, '<h2 class="colour-white">A mobile app for every side of education.<br />\r\n<strong>Starting with your SKOOL.</strong></h2>\r\n\r\n<p class="colour-white">Areas of education are turning digital, and so are parent demands. Parents like to be updated in a convenient way. A way that doesn&#39;t always require them to visit a blog, download a document or search your website relentlessly.</p>\r\n\r\n<p class="colour-white">SKOOLping&reg; is bringing the forefront of today&rsquo;s technology to your finger tips. Through an easy to use web interface built into your website&rsquo;s content management system, you&#39;ll seamlessly and directly be connecting to your community. Enabling you to ping updates for Events, News, Directions, Notifications, Pictures, Links, Documents, Forms - and much more.</p>\r\n\r\n<p><a class="abtn skoolping" href="javascript:void(0)">COMING SOON in 2017</a></p>\r\n'),
(867, '<h1><strong>Can&#39;t find what you&#39;re looking for?</strong> Let&#39;s chat, don&#39;t be shy.</h1>\r\n\r\n<p class="colour-grey"><a href="{CCM:BASE_URL}/index.php/design-development-solutions-and-services" title="website, ecommerce and mobile app design solutions">Have you seen my most common solutions?</a> I undertake many different request variations for my clients, from the smallest of things like a logo or icon design, right through to setting up their complete start-up branding or marketing campaign, involving multiple HTML email designs and creations - so that my client are only left to&nbsp;final check their content and click send.</p>\r\n\r\n<h2><strong>It may&nbsp;only take 5 minutes.</strong></h2>\r\n\r\n<p>Alternitivly, let me can call you. Leave your details and I&#39;ll call you back within a few hours, or ASAP. <em>If in the very rare occurrence that we can&#39;t help, we may know a trusted person who can.</em></p>\r\n'),
(868, '<h1><strong>Can&#39;t find what you&#39;re looking for?</strong> Let&#39;s chat, don&#39;t be shy.</h1>\r\n\r\n<p><a href="{CCM:BASE_URL}/index.php/design-development-solutions-and-services" title="website, ecommerce and mobile app design solutions">Have you seen my most common solutions?</a> I undertake many different request variations for my clients, from the smallest of things like a logo or icon design, right through to setting up their complete start-up branding or marketing campaign, involving multiple HTML email designs and creations - so that my client are only left to&nbsp;final check their content and click send.</p>\r\n\r\n<h2><strong>It may&nbsp;only take 5 minutes.</strong></h2>\r\n\r\n<p>Alternitivly, let me can call you. Leave your details and I&#39;ll call you back within a few hours, or ASAP. <em>If in the very rare occurrence that we can&#39;t help, we may know a trusted person who can.</em></p>\r\n'),
(869, '<h2><strong>Every design or development project are non-identical. These require&nbsp;different tacktical methods with slightly different solutions -&nbsp;each completed with passion and determination.&nbsp;Here are a few of my clients projects that not only delivered great client satisfaction, but have exceeded the above and beyond.</strong></h2>\r\n\r\n<p>Join our conversation online and&nbsp;<a href="{CCM:BASE_URL}/index.php/blog#">subscribe&nbsp;to receive our monthly newsletters</a>.<br />\r\nI&rsquo;ll only email you with important bits, never spam - that&#39;s a&nbsp;pinky promise!</p>\r\n'),
(870, '<h2 class="sub-heading colour-grey title-sub"><strong>While I&#39;m not knee deep in enjoyment with the undertaking of projects, I like to keep my clients and visitors up to date with the latest news and work from my studio and home in London, United Kingdom. Whether it&#39;s work life, client problem solving, learning new things, personal or family life - I enjoy telling stories.</strong></h2>\r\n\r\n<p>Join our conversation online and <a href="#">subscribe&nbsp;to receive our monthly newsletters</a>.<br />\r\nI&rsquo;ll only email you with important bits, never spam - that&#39;s a&nbsp;pinky promise!</p>\r\n'),
(873, '<h3>Conclusion</h3>\r\n\r\n<p>We feel that this project has not yet come to a close, but will continue to &quot;roll&quot; and improve, alongside CD Surveys Ltd. As technology imrpoves, we have plans to continue to implement.</p>\r\n\r\n<p>We look forward to see how this project will grow over time!</p>\r\n\r\n<p><a class="abtn orange" href="http://www.cdsurveys.com/" target="_blank">Take a look at their website</a></p>\r\n'),
