(905, '<p>The following terms and conditions document is a legal agreement between &ldquo;Chris Watterston&rdquo; and &ldquo;Client&rdquo; for the purposes of design, development, print or support &quot;Services&quot;. These Terms and Conditions set forth the provisions under which the Client may use the Services supplied.</p>\r\n\r\n<h2><strong>2. Acceptance Of Work</strong></h2>\r\n\r\n<p style="margin-left: 40px;">Quotation and, or proposals received by the recipient are valid for 14 days only, unless otherwise stated on the documentation.</p>\r\n\r\n<p style="margin-left: 40px;">No contract of service exists between Chris Watterston and Client until Chris Watterston receives written confirmation from client agreeing to the quoted or proposed project, via email or postal only.</p>\r\n\r\n<p style="margin-left: 40px;">Any other Services on the order, which have not been included in the quotation, proposal or invoice, do not form part of the contract. The Client agrees to check the details of the quotation, proposal or invoice are correct and should print, keeping a copy for their records. Chris Watterston reserves the right to withdraw from a contract at any time prior to acceptance, or after.</p>\r\n\r\n<h2><strong>3. Permissions &amp; Copyright</strong></h2>\r\n\r\n<p style="margin-left: 40px;">Copyright of the completed Services created by Chris Watterston for a project shall be with the Client in full upon final project completion, with full payment received by Chris Watterston. Without payment, ownership of Services created is with Chris Watterston.</p>\r\n\r\n<p style="margin-left: 40px;">The Client agrees that resale or distribution with the intension to gain profit from the Services and/ or the completed files in full or in part is forbidden without prior written agreement between the Client and Chris Watterston.</p>\r\n\r\n<p style="margin-left: 40px;">The Client hereby agrees that all media and content made available to Chris Watterston for use in the pr