(911, '<h2 class="type-semibold">Website Design</h2>\r\n\r\n<p>I take pride in ensuring that the online appearance of individuals, start-ups and established brands, go above and beyond compared to competitors. Let me create something beautiful for you and your audience.</p>\r\n'),
(912, '<h2 class="type-semibold">Mobile App</h2>\r\n\r\n<p>There are already so many mobile applications on the market that are identical from one another, you want something unique, something branded - that&#39;s what I do.&nbsp;Let me create something beautiful for you and your audience.</p>\r\n'),
(913, '<h2 class="type-semibold">eCommerce Design</h2>\r\n\r\n<p>Your shop, your brand. I bring your eCommerce store to life and integrate into Shopify. Your online store should be your store. Shopify allows me to take years of experience, and apply a bespoke solution to your store.</p>\r\n'),
(914, '<h2 class="type-semibold">Let&#39;s chat about your solution</h2>\r\n\r\n<p><a class="abtn orange" href="{CCM:CID_159}" title="find out about my solutions">find out about my solutions</a></p>\r\n'),
(915, '<h2 class="type-semibold">Let&#39;s chat about your solution</h2>\r\n\r\n<p><a class="abtn orange small" href="{CCM:CID_159}" title="find out about my solutions">find out about my solutions</a></p>\r\n'),
(916, '<p class="colour-white">Your shop, your brand. I bring your eCommerce store to life and integrate into Shopify. Your online store should be your store. Shopify allows me to take years of experience, and apply a bespoke solution to your store. Applying a bespoke designed solution, your brand will be present from the core, and beyond - something that doesn&#39;t come straight out the box! Bespoke domain names, everything you need in one place, a unified platform to run your store.</p>\r\n'),
(917, '<p class="colour-white">There are already so many mobile applications on the market that are identical from one another, you want something unique, something branded - that&#39;s what I do. I listen to individuals, start-ups and brands, to uniquely help them prepare them for what hungry excitement lies ahead. From the collaborative planning, through to design, development, testing and launch. Let me create something beautiful for you and your audience.</p>\r\n'),
(918, '<p class="colour-white">With the growing numbers of website on the internet, there are 100&#39;s, if not 1000&#39;s, of new comers during a month period. This means that the game gets harder with every day that passes. I take pride in ensuring that the online appearance of individuals, start-ups and established brands, go above and beyond compared to competitors. Let me create something beautiful for you and your audience.</p>\r\n'),
(919, '<h2 class="colour-orange"><strong>Creating Solutions</strong></h2>\r\n\r\n<p>Solutions resolve problems - they resolve a clients demand. Partnerships spark when a client has a problem that requires a solution. A bespoke solution that is provide by the understanding of the problem. With commitment from clients, it&#39;s what I reach for, what we partner for - what feeds my passion.</p>\r\n'),
(921, '<h2><strong>Your shop, your brand.</strong> I bring your eCommerce store to life and integrate into Shopify.</h2>\r\n\r\n<p>Your online store should be your store. Shopify allows me to take years of experience, and apply a bespoke solution to your store. Applying a bespoke designed solution, your brand will be present from the core, and beyond - something that doesn&#39;t come straight out the box! Bespoke domain names, everything you need in one place, a unified platform to run your store.</p>\r\n\r\n<p><strong>DID YOU KNOW - </strong>a&nbsp;study showed that 94% of users disTRUSTED a website because of the DESIGN made them uneasy.</p>\r\n\r\n<p><a class="abtn shopify" href="#ecommerce-form" title="Enquiry about your Shopify eCommerce solution"><strong>Build trust,</strong> Chat about your Shopify eCommerce project today.</a></p>\r\n'),
(922, '<h2><strong>Your mobile app, launch it.</strong> Let&#39;s take it to your already mobile addicted audience.</h2>\r\n\r\n<p>There are already so many mobile applications on the market that are identical from one another, you want something unique, something branded - that&#39;s what I do. I listen to individuals, start-ups and brands, to uniquely help them prepare them for what hungry excitement lies ahead. From the collaborative planning, through to design, development, testing and launch. Let me create something beautiful for you and your audience.&nbsp;</p>\r\n\r\n<p><strong>DID YOU KNOW - </strong>a&nbsp;study showed that the average user spends 67 hours a month browsing on their mobile device, with 90% of that time used within third-party installed&nbsp;applications.</p>\r\n\r\n<p><a class="abtn mobileapp" href="#mobileapp-form" title="Enquiry about your mobile application today">Don&#39;t regret it, chat about your mobile application project today</a></p>\r\n'),
(923, '<h2><strong>Stop dreaming, start achieving.</strong> I&#39;ll help make your website become reality.</h2>\r\n\r\n<p>With the growing numbers of website on the internet, there are 100&#39;s, if not 1000&#39;s, of new comers during a month period. This means that the game gets harder with every day that passes. I take pride in ensuring that the online appearance of individuals, start-ups and established brands, go above and beyond compared to competitors. Let me create something beautiful for you and your audience.</p>\r\n\r\n<p><strong>DID YOU KNOW - </strong>a study showed that 59% of consumers globally would rather engage with content that&#39;s beautifully designed as opposed to simply designed &mdash; even when short on time.</p>\r\n\r\n<p><a class="abtn websitedesign blue-dark" href="#websitedesign-form" title="Enquiry about your bespoke website design solution">Reach your online audience, chat about starting your website project today</a></p>\r\n'),
(924, '<h2><strong>Unique Clothing.</strong> On quality garments.</h2>\r\n\r\n<p><a class="abtn black" href="https://shop.spreadshirt.co.uk/chriswatterston/" target="_blank" title="View available there is no cloud clothing">View available clothing</a></p>\r\n'),
(925, '<p>But what do the top selling designs have in common? Is there a secret? What can other sellers learn?</p>\r\n\r\n<h2>There is no cloud</h2>\r\n\r\n<p>We connected with&nbsp;<a href="https://www.stickermule.com/user/1070269561/stickers" title="Sticker designs">Chris Watterston</a>&nbsp;the creator of the now famous and #1 bestselling &quot;<a href="https://www.stickermule.com/marketplace/3442-there-is-no-cloud" title="There Is No Cloud Sticker">There is no cloud</a>&quot; sticker to answer those questions.</p>\r\n\r\n<p><a class="abtn orange" href="https://www.stickermule.com/blog/there-is-no-cloud-getting-to-1-in-the-sticker-mule-marketplace" target="_blank" title="Read the full story on Sticker Mule">Read the full story on Sticker Mule</a></p>\r\n'),
(926, '<h1 class="colour-white"><strong>Cookie Policy.</strong> It&#39;s not the type you can eat.</h1>\r\n'),
(927, '<h2><strong>Chris Watterston uses cookies for certain areas of our various websites. This document provides further detail on what you should and need to know about how we use cookies and how you can manage or remove them should you so wish to. If after reading this, you continue to use this websites without any amends to your settings, we will assume you&#39;re happy to continue receiving all cookies on the Chris Watterston websites.</strong></h2>\r\n'),
(928, '<h2><strong>What is a Cookie</strong></h2>\r\n\r\n<p>A cookie is a piece of information in the form of a very small text file that is placed on an internet user&#39;s device storage. It is generated by a web page server, which is basically the computer that operates a web site. The information the cookie contains is set by the server and it can be used by that server whenever the user visits the site. A cookie can be thought of as an internet user&#39;s identification card, which tell a web site when the user has returned.</p>\r\n\r\n<h2><strong>Session Cookies</strong></h2>\r\n\r\n<p>Session Cookies are stored in the device memory only during a user&#39;s browsing session and are automatically deleted from the user&#39;s device when the browser is closed. These cookies usually store a session ID that is not personally identifiable to users, allowing the user to move from page to page without having to log-in repeatedly.</p>\r\n\r\n<p>Session Cookies are never written on the device hard drive and they do not collect any information from the user&#39;s device. Session cookies expire at the end of the user&#39;s browser session and can also become no longer accessible after the session has been inactive for a specified length of time, usually 20 minutes.</p>\r\n\r\n<h2><strong>Stored Cookies</strong></h2>\r\n\r\n<p>Stored Cookies are stored on the user&#39;s device and are not deleted when the browser is closed. Permanent cookies can retain user preferences for a particular web site, allowing those preferences to be used in future browsing sessions.</p>\r\n\r\n<p>Permanent cookies can be used to identify individual users, so they may be used by web sites to analyse users&#39; surfing behaviour within the web site. These cookies can also be used to provide information about numbers of visitors, the average time spent on a particular page and generally the performance of the web site.</p>\r\n\r\n<h2><strong>Third Party Cookies</strong></h2>\r\n\r\n<p>Third Party Cookies are not set directly by St. Paul&#39;s Catholic College, but by third-party providers. Third Party Cookies may be set by providers whose services or functionality is embedded in the St. Paul&#39;s Catholic College websites.</p>\r\n\r\n<h2><strong>Cookies&nbsp;Used on St. Paul&#39;s Catholic College Websites</strong></h2>\r\n\r\n<p>St. Paul&#39;s Catholic College websites uses Google Analytics to analyse the use of this website. Google Analytics generates statistical and other information about website use by means of cookies, which are stored on users&#39; device. The information generated relating to our website is used to create reports about the use of the website. Google will store and use this information. Google&#39;s privacy policy is available, visit&nbsp;<a href="http://google.com/policies/privacy/" target="_blank">google.com/policies/privacy</a>.</p>\r\n\r\n<h2><strong>Changes to this Cookie Policy</strong></h2>\r\n\r\n<p>St. Paul&#39;s Catholic College reserves the right to change this Cookie Policy as we deem necessary or appropriate because of legal compliance requirements or changes in our business practices. If you have provided us with an email address, we will endeavour to notify you, by email to that address, of any material change to how we will use personally identifiable information.</p>\r\n\r\n<h2><strong>Managing Cookies</strong></h2>\r\n\r\n<p>The Internet browser you use on your device allows you to manage cookies. You can modify your browser to notify you when cookies are being set. You can also set it to accept or refuse some or all cookies. You can even delete cookies that have already been set.</p>\r\n\r\n<p>Because each device and browser are different from each other, the way you amend the settings for cookies will vary. To find out how to manage your browser, visit&nbsp;<a href="http://www.aboutcookies.org/" target="_blank">www.aboutcookies.org</a>.</p>\r\n\r\n<p>Please be aware that completely disabling cookies on your device may not allow you to make full use of all the website features and functionality that are available.</p>\r\n'),
(929, '<h2><strong>What is a Cookie</strong></h2>\r\n\r\n<p>A cookie is a piece of information in the form of a very small text file that is placed on an internet user&#39;s device storage. It is generated by a web page server, which is basically the computer that operates a web site. The information the cookie contains is set by the server and it can be used by that server whenever the user visits the site. A cookie can be thought of as an internet user&#39;s identification card, which tell a web site when the user has returned.</p>\r\n\r\n<h2><strong>Session Cookies</strong></h2>\r\n\r\n<p>Session Cookies are stored in the device memory only during a user&#39;s browsing session and are automatically deleted from the user&#39;s device when the browser is closed. These cookies usually store a session ID that is not personally identifiable to users, allowing the user to move from page to page without having to log-in repeatedly.</p>\r\n\r\n<p>Session Cookies are never written on the device hard drive and they do not collect any information from the user&#39;s device. Session cookies expire at the end of the user&#39;s browser session and can also become no longer accessible after the session has been inactive for a specified length of time, usually 20 minutes.</p>\r\n\r\n<h2><strong>Stored Cookies</strong></h2>\r\n\r\n<p>Stored Cookies are stored on the user&#39;s device and are not deleted when the browser is closed. Permanent cookies can retain user preferences for a particular web site, allowing those preferences to be used in future browsing sessions.</p>\r\n\r\n<p>Permanent cookies can be used to identify individual users, so they may be used by web sites to analyse users&#39; surfing behaviour within the web site. These cookies can also be used to provide information about numbers of visitors, the average time spent on a particular page and generally the performance of the web site.</p>\r\n\r\n<h2><strong>Third Party Cookies</strong></h2>\r\n\r\n<p>Third Party Cookies are not set directly by Chris Watterston, but by third-party providers. Third Party Cookies may be set by providers whose services or functionality is embedded in the Chris Watterston websites.</p>\r\n\r\n<h2><strong>Cookies&nbsp;Used on Chris Watterston&#39;s Websites</strong></h2>\r\n\r\n<p>Chris Watterston&#39;s websites uses Google Analytics to analyse the use of this website. Google Analytics generates statistical and other information about website use by means of cookies, which are stored on users&#39; device. The information generated relating to our website is used to create reports about the use of the website. Google will store and use this information.</p>\r\n\r\n<p><strong>Analytics:</strong>&nbsp;We use Google Analytics, which creates a number of first-party cookies, all prefixed __utm:</p>\r\n\r\n<p style="margin-left: 40px;">__utma: contains a unique and anonymous identifying ID, which allows us to ensure that subsequent visits to our website are recorded as belonging to the same (unique) visitor. This cookie expires after two years.</p>\r\n\r\n<p style="margin-left: 40px;">__utmb: used to establish and continue a unique user session. Each time you request another page from the website the cookie is updated to expire after 30minutes.</p>\r\n\r\n<p style="margin-left: 40px;">__utmc: works with __utmb to determine when to create a new session for a website visitor. This is a session cookie and expires when you exit the browser.</p>\r\n\r\n<p style="margin-left: 40px;">__utmz: tracks how you found us and is used to calculate traffic and navigation within the website. It is updated with every new page view and expires after 6 months.</p>\r\n\r\n<p style="margin-left: 40px;">You may also sometimes find a __utmv cookie which relates to custom reporting segments, a feature which we occasionally use on Google Analytics.</p>\r\n\r\n<p>Full details of the cookies which Google Analytics uses can be found in&nbsp;<a href="https://developers.google.com/analytics/devguides/collection/analyticsjs/cookie-usage">Cookies &amp; Google Analytics</a>&nbsp;in documentation for Google&#39;s Analytics tracking code. You can also read&nbsp;<a href="http://www.google.co.uk/intl/en/analytics/privacyoverview.html" target="_blank">Google&#39;s Privacy Policy for Google Analytics</a>.&nbsp;</p>\r\n\r\n<h2><strong>Changes to this Cookie Policy</strong></h2>\r\n\r\n<p>Chris Watterston reserves the right to change this Cookie Policy as we deem necessary or appropriate because of legal compliance requirements or changes in our business practices. If you have provided us with an email address, we will endeavour to notify you, by email to that address, of any material change to how we will use personally identifiable information.</p>\r\n\r\n<h2><strong>Managing Cookies</strong></h2>\r\n\r\n<p>The Internet browser you use on your device allows you to manage cookies. You can modify your browser to notify you when cookies are being set. You can also set it to accept or refuse some or all cookies. You can even delete cookies that have already been set.</p>\r\n\r\n<p>Because each device and browser are different from each other, the way you amend the settings for cookies will vary. To find out how to manage your browser, visit&nbsp;<a href="http://www.aboutcookies.org/" target="_blank">www.aboutcookies.org</a>.</p>\r\n\r\n<p>Please be aware that completely disabling cookies on your device may not allow you to make full use of all the website features and functionality that are available.</p>\r\n'),
(930, '<h2><strong>These terms and conditions govern your use of our website; by using our website, you accept these terms and conditions in full.&nbsp;If you disagree with these terms and conditions or any part of these terms and conditions, you must not use our website. If you are under 18, please get your parent / guardian&#39;s permission before you provide personal information to our website.</strong></h2>\r\n'),
